import React, {Component} from 'react';
import {Grid, cell , Button} from 'react-mdl';
import "../../node_modules/bootstrap/dist/css/bootstrap.css";
import "../../node_modules/animate.css";
class LandingPage extends Component{
    render(){
        return( 
            <div style={{width: '100%', margin:'auto'}}>
            <Grid className="landing-grid">
                <cell col={4}>
               <div className="container"> 
               <h6 className="animate__animated animate__flash animate__repeat-3 animate__slow">Hi!</h6>
                <h1 className="animate__animated animate__backInDown animate__repeat-3 animate__slow">I Will Dseign for you a<span className="texts animate__animated animate__pulse animate__repeat-3 animate__slow"><br></br> Responsive website</span></h1>
                </div>
                </cell>
                <cell col={4}>
                <img src={process.env.PUBLIC_URL+"awaispic.jpg"} alt="my-pic"
                className="rounded-circle"/>
         </cell>
                 <cell col={4}>
                 <Button raised accent ripple className="btton">Higher me!</Button>
                 </cell>
            </Grid>
            </div>
           
        )
    }
}
export default LandingPage;
